import React from 'react';
import { View, Text } from 'react-native';

function AboutScreen({ navigation }) {
  return (
    <View>
      <Text>About Screen</Text>
    </View>
  );
}

AboutScreen.navigationOptions = {
  title: 'About',
};

export default AboutScreen;
